 `gender` tinyint(255) NULL ,
 `birthday` date NULL ,
 `mobile` varchar(255) NULL ,
 `phone` varchar(255) NULL ,
 `district` int(11) NULL ,
 `address` varchar(255) NULL ,
 `actived` tinyint(1) NULL  default '0' ,
 `last_login_time` datetime NULL ,
 `last_login_ip` varchar(255) NULL ,
 `first_login` tinyint(1) NULL  default '1' ,
 `total` bigint(21) NULL  default '0' 
)*/;

/*View structure for view view_mb */

/*!50001 DROP TABLE IF EXISTS `view_mb` */;
/*!50001 DROP VIEW IF EXISTS `view_mb` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_mb` AS (select count(1) AS `total`,`member_brand`.`member_id` AS `member_id` from `member_brand` group by `member_brand`.`member_id`) */;

/*View structure for view view_users */

/*!50001 DROP TABLE IF EXISTS `view_users` */;
/*!50001 DROP VIEW IF EXISTS `view_users` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_users` AS (select `members`.`id` AS `id`,`members`.`created` AS `created`,`members`.`modified` AS `modified`,`members`.`deleted` AS `deleted`,`members`.`email` AS `email`,`members`.`password` AS `password`,`members`.`nickname` AS `nickname`,`members`.`fullname` AS `fullname`,`members`.`gender` AS `gender`,`members`.`birthday` AS `birthday`,`members`.`mobile` AS `mobile`,`members`.`phone` AS `phone`,`members`.`district` AS `district`,`members`.`address` AS `address`,`members`.`actived` AS `actived`,`members`.`last_login_time` AS `last_login_time`,`members`.`last_login_ip` AS `last_login_ip`,`members`.`first_login` AS `first_login`,`view_mb`.`total` AS `total` from (`members` left join `view_mb` on((`members`.`id` = `view_mb`.`member_id`)))) */;

